using BenchmarkDotNet.Attributes;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Text.RegularExpressions;
using System.Threading.Tasks;

namespace Benchmarks.Dotnet
{
    public class OtherTest
    {
        [GlobalSetup]
        public void Setup()
        {
            _regexSystem = new Regex(pattern, RegexOptions.Compiled);
            _regexSystemComplex = new Regex(complexpattern, RegexOptions.Compiled);
            _regexSystemStupidPattern = new Regex(stupidpattern, RegexOptions.Compiled);
        }

        private const string pattern = "[0-9]{3}-[0-9]{3}-[0-9]{4}";
        private const string complexpattern = "[0-9]{3}-[0-9]{3}-[0-9]{4}";
        private const string stupidpattern = "(x+x+)+y";
        #region awfullongstring
        private const string awfullongstring = "";
        #endregion
        private Regex _regexSystem;
        private Regex _regexSystemComplex;
        private Regex _regexSystemStupidPattern;

        [Benchmark]
        public void SystemRegexMatch()
        {
            var re = new Regex(pattern, RegexOptions.None);
            var m = re.Match("123-123-1234");
            m = re.Match("123-1231234");
            m = re.Match("123-323-1234");
            m = re.Match("123-323-1235");
            m = re.Match("123-323--1235");
        }

        [Benchmark]
        public void SystemRegexCompiled()
        {
            var re = _regexSystem;
            var m = re.Match("123-123-1234");
            m = re.Match("123-1231234");
            m = re.Match("123-323-1234");
            m = re.Match("123-323-1235");
            m = re.Match("123-323--1235");
        }

        [Benchmark]
        public void SystemRegexCompiledComplex()
        {
            var re = _regexSystemComplex;
            var m = re.Match("key1=val1&token=a0b21ce2-006f-4cc6-95d5-d7b550698482&key2=val2");
            m = re.Match("key1=val1&token=a0b21ce2-006f-4cc6-xzzzzzzzzzzz95d5-d7b550698482&key2=val2");
            m = re.Match("key1=val1&pass=aaaaaaaaaaaaa&key2=val2");
        }

    }
}
